label("$C$",C,NE);
label("$D$",D,NW);
label("$E$",I,W);
label("$F$",(2,4),NW);
label("$G$",(5,0),S);
draw((5,0)--C,dashed);
draw((5,0)--(2,4),dashed);
draw((5,0)--I,dashed);
[/asy]

