doc.problem:
Two $4\times 4$ squares intersect at right angles, bisecting their intersecting sides, as shown. The circle's diameter is the segment between the two points of intersection. What is the area of the shaded region created by removing the circle from the squares? [asy]
/* AMC8 2004 #25 Problem */
path square=((0,0)--(4,0)--(4,4)--(0,4)--cycle);
filldraw(shift(-sqrt(8)/2.0)*rotate(45)*square, lightgrey, black);
filldraw(shift(sqrt(8)/2,0)*rotate(45)*square, lightgrey, black);
filldraw(circle((0,sqrt(8)), sqrt(8)/2), white, black);
[/asy]

doc.solution:
Rotating $360^\circ$ is the same as doing nothing, so rotating $1755^\circ$ is the same as rotating $1755^\circ - 4\cdot 360^\circ = 315^\circ$.  Therefore, we have $\sin 1755^\circ = \sin (1755^\circ - 4\cdot 360^\circ) = \sin 315^\circ$.

Let $P$ be the point on the unit circle that is $315^\circ$ counterclockwise from $(1,0)$, and let $D$ be the foot of the altitude from $P$ to the $x$-axis, as shown below.

[asy]

pair A,C,P,O,D;

draw((0,-1.2)--(0,1.2),p=black+1.2bp,Arrows(0.15cm));

draw((-1.2,0)--(1.2,0),p=black+1.2bp,Arrows(0.15cm));

A = (1,0);

O= (0,0);

label("$x$",(1.2,0),SE);

label("$y$",(0,1.2),NE);

P = rotate(315)*A;

D = foot(P,A,-A);

draw(O--P--D);

draw(rightanglemark(O,D,P,2));

draw(Circle(O,1));

label("$O$",O,NW);

label("$P$",P,SE);

//label("$A$",A,SE);

label("$D$",D,N);

[/asy]

Triangle $POD$ is a 45-45-90 triangle, so $DO = DP = \frac{\sqrt{2}}{2}$.  Therefore, the coordinates of $P$ are $\left(\frac{\sqrt{2}}{2}, -\frac{\sqrt{2}}{2}\right)$, so $\sin 1755^\circ = \sin 315^\circ = \boxed{-\frac{\sqrt{2}}{2}}$.

