Therefore, $$h=\sqrt{1-(PC)^2} = \sqrt{1-\left(\frac 1{\sqrt 3}\right)^2} = \sqrt{1-\frac 13} = \sqrt{\frac 23} = \frac{\sqrt 2}{\sqrt 3},$$and the volume of tetrahedron $ABCD$ is \begin{align*}
