&= \frac 13\cdot\left(\frac 12\cdot 1\cdot \frac{\sqrt 3}2\right)\cdot \frac{\sqrt 2}{\sqrt 3} \\
&= \frac{\sqrt 2}{12};
\end{align*}the square of the volume is $$V^2 = \left(\frac{\sqrt 2}{12}\right)^2 = \frac{2}{144} = \boxed{\frac 1{72}}.$$

