Since $\overline{BM}$ is a median of $\triangle BCD$, point $G$ is on $\overline{BM}$ such that $BG = \frac23BM$.  From 30-60-90 triangle $BMC$, we have $BM = \frac{\sqrt{3}}{2}\cdot BC$, so \[BG = \frac23BM =\frac23\cdot \frac{\sqrt{3}}{2}\cdot BC = \frac{\sqrt{3}}{3} \cdot BC.\]Finally, since $AB = BC$, we have  \[\cos \angle ABM = \cos \angle ABG = \frac{BG}{AB} = \frac{(\sqrt{3}/3)BC}{BC}=\boxed{\frac{\sqrt{3}}{3}}.\]

